import React from 'react'
import styled from 'styled-components'
import Task from './Task.js';

const Taskbar = () => {
    return (
        <Container>
            <Task />
            <Task />
            <Task />
            <Task /><Task />
            <Task /><Task />
            <Task /><Task />
            <Task /><Task />
            <Task />

        </Container>
    )
}

export default Taskbar

const Container = styled.div`
    width: 100%;
    height: 80%;
    max-height: 600px;
    padding: 0;     
    margin: 0;
    background-color: blue;
    overflow-y: scroll;

`
